INSERT INTO `books` (`book_id`, `title`, `isbn`, `publisher`, `price`, `quantity`, `short_description`, `long_description`, `book_pic`) VALUES
(2, 'The Teenage Mutant Ninja Turtles Pizza Cookbook', '9781608878314', 'Insight Editions', '16.39', 2, 'Host the ultimate pizza party with this creative cookbook of delicious recipes inspired by the heroes of the Teenage Mutant Ninja Turtles.', 'Straight out of the sewers and right into the kitchen, the Teenage Mutant Ninja Turtles\' favorite pizzas are finally yours to create and enjoy! Join Leonardo, Raphael, Donatello, and Michelangelo on a seriously ooey, gooey, cheesy, adventure inspired by the beloved original cartoon series. \r\n\r\nThis cookbook contains sixty-five righteous recipes, from old-school classic such the New York Style Pepperoni to newfangled feasts such as the Lean, Mean, and Green and Shredder\'s Revenge. There\'s a pizza for every occasion -- breakfast pizzas, mini-pizzas, party pizzas, and even dessert pizzas. So get on the ninja diet and be prepared to eat your hearts out! Cowabunga! \r\n\r\n© 2017 Viacom International Inc. and Viacom Overseas Holdings C.V.  All rights reserved.  Nickelodeon, Teenage Mutant Ninja Turtles, and all related titles, logos, and characters are trademarks of Viacom International Inc. and Viacom Overseas Holdings C.V. Based on the characters created by Peter Laird and Kevin Eastman.', );
INSERT INTO `books` (`book_id`, `title`, `isbn`, `publisher`, `price`, `quantity`, `short_description`, `long_description`, `book_pic`) VALUES
(3, 'Crushing It!: How Great Entrepreneurs Build Their Business and Influence-and How You Can, Too', '9780062674678', 'HarperBusiness', '12.84', 14, 'Four-time New York Times bestselling author Gary Vaynerchuk offers new lessons and inspiration drawn from the experiences of dozens of influencers and entrepreneurs who rejected the predictable corporate path in favor of pursuing their dreams by building thriving businesses and extraordinary personal brands.', 'In his 2009 international bestseller Crush It, Gary insisted that a vibrant personal brand was crucial to entrepreneurial success, In Crushing It!, Gary explains why that’s even more true today, offering his unique perspective on what has changed and what principles remain timeless. He also shares stories from other entrepreneurs who have grown wealthier—and not just financially—than they ever imagined possible by following Crush It principles. The secret to their success (and Gary’s) has everything to do with their understanding of the social media platforms, and their willingness to do whatever it took to make these tools work to their utmost potential. That’s what Crushing It! teaches readers to do.\r\n\r\nIn this lively, practical, and inspiring book, Gary dissects every current major social media platform so that anyone, from a plumber to a professional ice skater, will know exactly how to amplify his or her personal brand on each. He offers both theoretical and tactical advice on how to become the biggest thing on old standbys like Twitter, Facebook, YouTube, Instagram, Pinterest, and Snapchat; podcast platforms like Spotify, Soundcloud, iHeartRadio, and iTunes; and other emerging platforms such as Musical.ly. For those with more experience, Crushing It! illuminates some little-known nuances and provides innovative tips and clever tweaks proven to enhance more common tried-and-true strategies.\r\n\r\nCrushing It! is a state-of-the-art guide to building your own path to professional and financial success, but it’s not about getting rich. It’s a blueprint to living life on your own terms.', );
INSERT INTO `books` (`book_id`, `title`, `isbn`, `publisher`, `price`, `quantity`, `short_description`, `long_description`, `book_pic`) VALUES
