INSERT INTO `books` (`book_id`, `title`, `isbn`, `publisher`, `price`, `quantity`, `short_description`, `long_description`, `book_pic`) VALUES
(5, 'Bartleby, the Scrivener: A Story of Wall Street', '9781480255418', 'CreateSpace Independent Publishing Platform', '5.59', 23, 'Bartleby, the Scrivener is the short story by Herman Melville now brought to you in this new edition of the timeless classic.', 'HERMAN MELVILLE (1819-1891) was born in New York City. Family hardships forced him to leave school for various occupations, including shipping as a cabin boy to Liverpool in 1839--a voyage that sparked his love for the sea. A shrewd social critic and philosopher in his fiction, he is considered an outstanding writer of the sea and a great stylist who mastered both realistic narrative and a rich, rhythmical prose. He is best known for his novel Moby-Dick and the posthumously published novella Billy Budd.', );
INSERT INTO `books` (`book_id`, `title`, `isbn`, `publisher`, `price`, `quantity`, `short_description`, `long_description`, `book_pic`) VALUES
(6, 'Typee', '9781544014852', 'CreateSpace Independent Publishing Platform', '10.50', 6, 'Based on Melville\'s actual experiences after having jumped ship in the Marquesas Islands, this work was extremely popular, and provoked disbelief among its readers until the events it described were corroborated by Melville\'s fellow castaway, Richard Greene. While the book is based on fact, Typee is properly considered a work of fiction: the three week stay on which the author based his story is extended to four months, and Melville drew extensively on contemporary accounts by Pacific explorers to add cultural detail to what might otherwise have been a straightforward story of escape, capture and re-escape.', 'About the Author\r\n\r\nThe writing career of Herman Melville (1819 - 1891) peaked early, with his early novels, such as Typee becoming best sellers. By the mid-1850s his popularity declined sharply, and by the time he died he had been largely forgotten. Yet in time his novel Moby Dick came to be regarded as one of the finest works of American, and indeed world, literature, as was Billy Budd, which was not published until long after his death, in 1924.', );
INSERT INTO `books` (`book_id`, `title`, `isbn`, `publisher`, `price`, `quantity`, `short_description`, `long_description`, `book_pic`) VALUES
(7, 'Moby Dick', '9781853260087', 'Wordsworth Editions Ltd', '3.99', 9, 'A young seaman joins the crew of the whaling ship Pequod, let by the fanatical Captain Ahab in pursuit of the white whale Moby Dick in this children\'s version of Melville\'s Moby Dick. .', 'With an Introduction and Notes by David Herd. Lecturer in English and American Literature at the University of Kent at Canterbury Moby-Dick is the story of Captain Ahab\'s quest to avenge the whale that \'reaped\' his leg. The quest is an obsession and the novel is a diabolical study of how a man becomes a fanatic. But it is also a hymn to democracy. Bent as the crew is on Ahab s appalling crusade, it is equally the image of a co-operative community at work: all hands dependent on all hands, each individual responsible for the security of each. Among the crew is Ishmael, the novel\'s narrator, ordinary sailor, and extraordinary reader. Digressive, allusive, vulgar, transcendent, the story Ishmael tells is above all an education: in the practice of whaling, in the art of writing.', );
INSERT INTO `books` (`book_id`, `title`, `isbn`, `publisher`, `price`, `quantity`, `short_description`, `long_description`, `book_pic`) VALUES
(8, 'The Adventures of Huckleberry Finn', '9781974296392', 'CreateSpace Independent Publishing Platform', '7.99', 9, 'The seemingly simple story of a young boy, his friendship with a black slave and their momentous journey together has been challenged time and again in schools all across America, owing mostly to its treatment of race and what has been described as “vulgar language.” But it is still one of Mark Twain’s most popular novels, a sequel to his previous best-seller Tom Sawyer, and one of the first examples of American literature whose narrator speaks in the local dialect of his region. The Adventures of Huckleberry Finn is charmingly controversial, not unlike its outspoken author.', '', NULL);
INSERT INTO `books` (`book_id`, `title`, `isbn`, `publisher`, `price`, `quantity`, `short_description`, `long_description`, `book_pic`) VALUES
(9, 'The Purloining of Prince Oleomargarine', '9780553523225', 'Random House Children\'s Books', '16.73', 4, 'In a hotel in Paris one evening in 1879, Mark Twain sat with his young daughters, who begged their father for a story. Twain began telling them the tale of Johnny, a poor boy in possession of some magical seeds. Later, Twain would jot down some rough notes about the story, but the tale was left unfinished . . . until now.', 'Plucked from the Mark Twain archive at the University of California at Berkeley, Twain’s notes now form the foundation of a fairy tale picked up over a century later. With only Twain’s fragmentary script and a story that stops partway as his guide, author Philip Stead has written a tale that imagines what might have been if Twain had fully realized this work.\r\n \r\nJohnny, forlorn and alone except for his pet chicken, meets a kind woman who gives him seeds that change his fortune, allowing him to speak with animals and sending him on a quest to rescue a stolen prince. In the face of a bullying tyrant king, Johnny and his animal friends come to understand that generosity, empathy, and quiet courage are gifts more precious in this world than power and gold.\r\n \r\nIlluminated by Erin Stead’s graceful, humorous, and achingly poignant artwork, this is a story that reaches through time and brings us a new book from America’s most legendary writer, envisioned by two of today’s most important names in children’s literature.', );
INSERT INTO `books` (`book_id`, `title`, `isbn`, `publisher`, `price`, `quantity`, `short_description`, `long_description`, `book_pic`) VALUES
(10, 'The Adventures of Tom Sawyer', '9781402767623', 'Sterling', '14.15', 3, ' “Saturday morning was come, and all the summer world was bright and fresh, and brimming with life.”\r\n\r\nSo starts Mark Twain’s classic tale about a boy’s life in a small town on the Mississippi, which has become an all-time favorite both in America and around the world.', 'Tom Sawyer’s mischievous and by now famous exploits—venturing into a nighttime graveyard with his friend Huck Finn, getting lost in a bat cave, tricking his friends into whitewashing a fence—make thrilling reading for all ages. Behind the escapades, though, are darker themes, as young Tom learns some difficult lessons about the often hypocritical rules that govern adult society.\r\n\r\nThis new edition, which celebrates the centenary of Mark Twain\'s death, brings together the complete text with more than 70 stunning illustrations by artist Robert Ingpen, each one an enchanting evocation of a forgotten time in the American South.', );
INSERT INTO `books` (`book_id`, `title`, `isbn`, `publisher`, `price`, `quantity`, `short_description`, `long_description`, `book_pic`) VALUES
(11, 'Prince and the Pauper', '9781593082185', 'Barnes & Noble', '8.95', 5, ' “With its mixing of high adventure, raucous comedy, and scathing social criticism, presented in a hilarious faux-sixteenth-century vernacular that only Mark Twain could fashion, The Prince and the Pauper remains one of this incomparable humorist’s most popular and oft-dramatized tales.”\r\n\r\nSo starts Mark Twain’s classic tale about a boy’s life in a small town on the Mississippi, which has become an all-time favorite both in America and around the world.', 'All editions are beautifully designed and are printed to superior specifications; some include illustrations of historical interest. Barnes & Noble Classics pulls together a constellation of influences—biographical, historical, and literary—to enrich each reader\'s understanding of these enduring works.\r\n\r\nWhen Mark Twain’s The Prince and the Pauper was published in 1881, the Atlanta Constitution sang its praises in no uncertain terms: “The book comes upon the reading public in the shape of a revelation.” A timeless tale of switched identities, Twain’s story revolves around the miserably poor Tom Canty “of Offal Court,” who is lucky enough to trade his rags for the gilded robes of England’s prince, Edward Tudor. As each boy is mistaken for the other, Tom enters a realm of privilege and pleasure beyond his most delirious dreams, while Edward plunges into a cruel, dangerous world of beggars and thieves, cutthroats and killers. Befriended by the heroic Miles Hendon, Edward struggles to survive on the squalid streets of London, in the process learning about the underside of life in “Merry England.”', );
INSERT INTO `books` (`book_id`, `title`, `isbn`, `publisher`, `price`, `quantity`, `short_description`, `long_description`, `book_pic`) VALUES
(12, 'Letters from the Earth: Uncensored Writings', '9780060518653', 'Harper Perennial Modern Classics', '12.18', 1, ' In Letters from the Earth, Twain presents himself as the Father of History -- reviewing and interpreting events from the Garden of Eden through the Fall and the Flood, translating the papers of Adam and his descendants through the generations. First published fifty years after his death, this eclectic collection is vintage Twain: sharp, witty, imaginative, complex, and wildly funny.', 'About the Author\r\n\r\nMark Twain, who was born Samuel L. Clemens in Missouri in 1835, wrote some of the most enduring works of literature in the English language, including The Adventures of Tom Sawyer and The Adventures of Huckleberry Finn. Personal Recollections of Joan of Arc was his last completed book—and, by his own estimate, his best. Its acquisition by Harper & Brothers allowed Twain to stave off bankruptcy. He died in 1910. ', );
INSERT INTO `books` (`book_id`, `title`, `isbn`, `publisher`, `price`, `quantity`, `short_description`, `long_description`, `book_pic`) VALUES
(13, 'Oh, the Places You\'ll Go!', '9780679805274', 'Random House', '15.51', 19, 'Dr. Seuss’s wonderfully wise Oh, the Places You’ll Go! is the perfect send-off for grads—from nursery school, high school, college, and beyond! ', 'From soaring to high heights and seeing great sights to being left in a Lurch on a prickle-ly perch, Dr. Seuss addresses life’s ups and downs with his trademark humorous verse and illustrations, while encouraging readers to find the success that lies within. In a starred review, Booklist notes, “Seuss’s message is simple but never sappy: life may be a ‘Great Balancing Act,’ but through it all ‘There’s fun to be done.’” A perennial favorite and a perfect gift for anyone starting a new phase in their life!', );
INSERT INTO `books` (`book_id`, `title`, `isbn`, `publisher`, `price`, `quantity`, `short_description`, `long_description`, `book_pic`) VALUES
(14, 'The Cat in the Hat', '9780394800011', 'Random House', '6.39', 8, 'Poor Dick and Sally. It\'s cold and wet and they\'re stuck in the house with nothing to do . . . until a giant cat in a hat shows up, transforming the dull day into a madcap adventure and almost wrecking the place in the process! Written by Dr. Seuss in 1957 in response to the concern that \"pallid primers [with] abnormally courteous, unnaturally clean boys and girls\' were leading to growing illiteracy among children, The Cat in the Hat (the first Random House Beginner Book) changed the way our children learn how to read. ', 'He may be an old standby, but he never lets us down. When in doubt, turn to the story of the cat that transformed a dull, rainy afternoon into a magical and just-messy-enough adventure. There\'s another, hidden adventure, too: this book really will help children learn to read. With his simple and often single-vowel vocabulary, the good Doctor knew what he was doing: hear it, learn it, read it--laughing all the way. The Cat in the Hat is a must for any child\'s library. ', );

